import { Component } from 'react';
import './style.css';


class Profile extends Component{
    constructor(){
        super()
    }
    render(){
        return(
            <div className='profile-container'>
                <div className='profile-left-container'>
                    <h1>MY PROFILE</h1>
                    <div className='profile-left-bold-container'>
                        <h3>Name</h3>
                        <h3>Birthday</h3>
                        <h3>Address</h3>
                        <h3>Phone</h3>
                        <h3>Email</h3>
                        <h3>Website</h3>
                    </div>
                    <div>
                        <p>Huseyn Eyvazov</p>
                        <p>17.05.2006</p>
                        <p>Baku,Azerbaijan</p>
                        <p>+994-50-322-49-00</p>
                        <p>heyvazov15@gmail.com</p>
                        <p>www.EyvazovHuseyn.com</p>
                    </div>
                </div>
                <div className='profile-right-container'>
                <h1>SOME SKILLS</h1>
                </div>
            </div>
        )
    }
}
export default Profile;
